    "tic('Dataset preparation & feature engineering.')\n",
    "\n",
    "feat_eng <- function(df){\n",
    "\n",
    "    ### Prepare factors\n",
    "    df$gender <- as.factor(df$gender)\n",
    "    df$course <- as.factor(df$course)\n",
    "    df$internet_access <- as.factor(df$internet_access)\n",
    "    df$sleep_quality <- as.factor(df$sleep_quality)\n",
    "    df$study_method <- as.factor(df$study_method)\n",
    "    df$facility_rating <- as.factor(df$facility_rating)\n",
    "    df$exam_difficulty <- as.factor(df$exam_difficulty)\n",
    "    \n",
    "    return (df)\n",
    "}\n",
    "train_fe <- feat_eng(train)\n",
    "test_fe <- feat_eng(test)\n",
    "\n",
    "toc()"
   ]
  },
