   "source": [
    "tic('Model training')\n",
    "\n",
    "set.seed(1)\n",
    "\n",
    "trainIndex <- createDataPartition(train_fe$exam_score, p = .8, list = FALSE, times = 1)\n",
    "train_ = train_fe[ trainIndex,]\n",
    "valid_ = train_fe[-trainIndex,]\n",
    "\n",
    "train_pool <- catboost.load_pool(data = train_ %>% select(-c(id,exam_score)), label = train_$exam_score,cat_features=cat_cols) \n",
    "valid_pool <- catboost.load_pool(data = valid_ %>% select(-c(id,exam_score)), label = valid_$exam_score,cat_features=cat_cols) \n",
    "\n",
    "params <- list(random_seed =1, \n",
    "               loss_function = 'RMSE',\n",
    "               eval_metric = 'RMSE',\n",
    "               iterations = 2000,\n",
    "               early_stopping_rounds = 100,\n",
    "               prediction_type = 'RawFormulaVal',\n",
    "               task_type = 'CPU',\n",
    "               logging_level = 'Silent')\n",
    "\n",
    "model <- catboost.train(train_pool, params = params)\n",
    "preds <- catboost.predict(model, valid_pool,prediction_type='RawFormulaVal')\n",
    "\n",
    "print(rmse(valid_$exam_score,preds))\n",
    "\n",
    "toc()"
   ]
  },
